import './ButtonBack.css';
import { BsCaretUpFill } from 'react-icons/bs';
import { Link } from 'react-scroll';
import { useState } from 'react';
import { useUrlPathname } from '../../store/index.js';

const ButtonBack = () => {
  const [getUrl, setUrl] = useState('home');
  const pathUrl = () => {
    useUrlPathname((state) => state.path)
  }

  return (
    <div className='container button-back'>
      <div className='mdui-ripple mdui-ripple-black'>
        <Link onClick={() => pathUrl()} to={getUrl} smooth={true} offset={-100} duration={1000} ><BsCaretUpFill values={{ className: 'icon' }} /></Link>
      </div>
    </div>
  )
}

export default ButtonBack;
